B.B9=new A.dk("What time should I arrive?","For guests attending the reception, it will start at 6:00 PM. We ask that you arrive on time for this portion of the event. We have a lot of fun planned and we don't want you to miss out on anything!\n\nFor guests attending other events in the day, please refer to the schedule you were sent, or contact us for more information.",null)
B.B2=new A.dk("What should I wear?","All guests are encouraged to wear their Sunday best. The wedding colors are dark teal and gold, but you are not required to wear those colors. Please pick something that you would be comfortable having your picture taken in.",null)
B.B3=new A.dk("Will there be alcohol?","No. There will not be any alcohol provided and we ask that you do not bring any. Our venue does not allow alcohol on the premises. Additionally, we do not drink, so we will not accept any gifts of alcohol.",null)
B.AY=new A.dk("Can I smoke at the event?","No. Our venue does not allow smoking on the premises. We ask that you refrain from smoking during all events. If you need to smoke, please leave the premises to do so.",null)
B.B5=new A.dk("Can I take pictures?","We have an amazing photographer who will be taking pictures of everything throughout the event. We encourage you to enjoy your time with us and let the photographer capture the moments. However, if you would like to take pictures, as long as you turn your flash off and you do not obscure the photographer, you are welcome to take as many as you'd like.",null)
B.B8=new A.dk("Can I bring a gift?","Your presence is the best gift we could ask for. We do not expect any gifts, but if you would like to give us something, we have a registry available under the registry tab of this website with our preferred gifts.",null)
B.B_=new A.dk("Can I send a gift to your home instead of bringing it to the wedding?","If you would like to send us a gift, please contact us to make arrangments.",null)
B.B0=new A.dk("Can I bring a plus one?","Yes, you may bring a plus one. Please make sure to include them in your RSVP so we can make sure to plan for everyone.",null)
B.B6=new A.dk("Can I bring my kids?","We love kids and would love to have them at our wedding. However, we will not have any activities or childcare available, so if you choose to bring them it is your responsibility to keep them entertained and quiet during the event. Please make sure to include them in your RSVP so we can plan for them.",null)
B.B7=new A.dk("Can I attend the Temple Sealing?","A temple sealing is a sacred and deeply meaningful ceremony performed in a temple of The Church of Jesus Christ of Latter-day Saints. In this ceremony, we are united as husband and wife, not just for this life but for eternity. It's an opportunity for us to make sacred promises to each other and to God.\n\nTemple sealings take place in dedicated spaces that are set apart as holy. To maintain the sacred nature of these ordinances, attendance is limited to members of our faith who hold an active temple recommend, which is a personal commitment to live in accordance with the teachings of the gospel.\n\nWe deeply value and love everyone in our lives, and while this part of the day is intimate and spiritual, we are excited to celebrate with all of you during the rest of the events planned for the day. If you do not possess a temple recommend, we would love to have you join us for photos at the temple, the luncheon and reception. Your presence in our lives is incredibly important to us, and we feel blessed to have your support.",null)
B.B1=new A.dk("Will there be food?","Yes! We will have refreshments at the reception. If you have any dietary restrictions, please make sure to include them in your RSVP so we can plan accordingly.",null)
B.AZ=new A.dk("Will you be providing hotels and transport?","No, we will not be providing hotels or transport for any of our guests. If you are coming from out of town, please book your own accommodations and arrange for any transport you will need throughout the day.",null)
B.AX=new A.dk("Who should I contact on the day of the wedding if I have trouble finding the venue or have questions?","On the day of the wedding, if you have any trouble finding the venue or have any questions, please contact Amanda DeClerk, at 515-238-5551.",null)
B.B4=new A.dk("What is the best way to get in touch with you guys if I have questions prior to the wedding?","The best way to get in touch with us is to text us at 515-313-8558 and 657-357-1642. We will do our best to respond to you in a timely manner.",null)
